import React, { useState } from 'react';
import Button from '../ui/Button';
import logo from '../../assets/images/logo.png';
import clockimage from '../../assets/images/clock-image.png';

const SignUp = () => {
    const [formData, setFormData] = useState({
        fullName: '',
        email: '',
        password: '',
        confirmPassword: ''
    });

    const [errors, setErrors] = useState({
        confirmPassword: ''
    });

    const handleChange = (e) => {
        const { name, value } = e.target;
        setFormData({
            ...formData,
            [name]: value
        });

        // Clear error when user starts typing in confirm password
        if (name === 'confirmPassword') {
            if (value !== formData.password) {
                setErrors({
                    ...errors,
                    confirmPassword: 'Passwords do not match'
                });
            } else {
                setErrors({
                    ...errors,
                    confirmPassword: ''
                });
            }
        }

        // If password changes, re-validate confirm password
        if (name === 'password' && formData.confirmPassword) {
            if (value !== formData.confirmPassword) {
                setErrors({
                    ...errors,
                    confirmPassword: 'Passwords do not match'
                });
            } else {
                setErrors({
                    ...errors,
                    confirmPassword: ''
                });
            }
        }
    };

    const handleSubmit = (e) => {
        e.preventDefault();

        // Final validation before submit
        if (formData.password !== formData.confirmPassword) {
            setErrors({
                ...errors,
                confirmPassword: 'Passwords do not match'
            });
            return;
        }

        console.log('Sign up data:', formData);
        // If passwords match, proceed with form submission
    };

    return (
        <div className="min-h-screen bg-background flex">
            {/* Left side - Form */}
            <div className="flex-1 flex items-center justify-center p-8">
                <div className="max-w-md w-full">
                    {/* Logo */}
                    <div className="text-center mb-8">
                        <img
                            src={logo}
                            alt="Equilibrio"
                            className="h-12 mx-auto mb-4"
                        />
                        <h1 className="text-2xl font-bold text-text">Equilibrio</h1>
                    </div>

                    {/* Form */}
                    <div className="bg-white rounded-2xl shadow-lg p-8">
                        <h1 className="text-3xl font-bold text-text text-center mb-2">
                            Create an account
                        </h1>
                        <p className="text-metallic-gray text-center mb-8">
                            Please enter your details to register
                        </p>

                        <form onSubmit={handleSubmit}>
                            {/* Full Name */}
                            <div className="mb-6">
                                <label className="block text-text font-medium mb-3">
                                    Full Name
                                </label>
                                <input
                                    type="text"
                                    name="fullName"
                                    value={formData.fullName}
                                    onChange={handleChange}
                                    placeholder="Full name"
                                    className="w-full p-4 border border-strokes rounded-lg bg-white placeholder-placeholder focus:outline-none focus:ring-2 focus:ring-blue focus:border-transparent"
                                    required
                                />
                            </div>

                            {/* Email */}
                            <div className="mb-6">
                                <label className="block text-text font-medium mb-3">
                                    Email
                                </label>
                                <input
                                    type="email"
                                    name="email"
                                    value={formData.email}
                                    onChange={handleChange}
                                    placeholder="example@gmail.com"
                                    className="w-full p-4 border border-strokes rounded-lg bg-white placeholder-placeholder focus:outline-none focus:ring-2 focus:ring-blue focus:border-transparent"
                                    required
                                />
                            </div>

                            {/* Password */}
                            <div className="mb-6">
                                <label className="block text-text font-medium mb-3">
                                    Password
                                </label>
                                <input
                                    type="password"
                                    name="password"
                                    value={formData.password}
                                    onChange={handleChange}
                                    placeholder="••••••••"
                                    className="w-full p-4 border border-strokes rounded-lg bg-white placeholder-placeholder focus:outline-none focus:ring-2 focus:ring-blue focus:border-transparent"
                                    required
                                />
                            </div>

                            {/* Confirm Password */}
                            <div className="mb-6">
                                <label className="block text-text font-medium mb-3">
                                    Confirm Password
                                </label>
                                <input
                                    type="password"
                                    name="confirmPassword"
                                    value={formData.confirmPassword}
                                    onChange={handleChange}
                                    placeholder="••••••••"
                                    className={`w-full p-4 border rounded-lg bg-white placeholder-placeholder focus:outline-none focus:ring-2 focus:ring-blue focus:border-transparent ${
                                        errors.confirmPassword ? 'border-error' : 'border-strokes'
                                    }`}
                                    required
                                />
                                {errors.confirmPassword && (
                                    <p className="text-error text-sm mt-2">{errors.confirmPassword}</p>
                                )}
                            </div>

                            {/* Divider */}
                            <div className="relative my-6">
                                <div className="absolute inset-0 flex items-center">
                                    <div className="w-full border-t border-strokes"></div>
                                </div>
                            </div>

                            {/* Submit Button */}
                            <Button
                                type="submit"
                                variant="primary"
                                disabled={!!errors.confirmPassword}
                                className={errors.confirmPassword ? 'opacity-50 cursor-not-allowed' : ''}
                            >
                                Create Account
                            </Button>
                        </form>

                        {/* Footer */}
                        <div className="text-center mt-6">
                            <p className="text-metallic-gray">
                                Already have an account?{' '}
                                <a href="/login" className="text-blue font-medium hover:text-blue-600">
                                    Sign in
                                </a>
                            </p>
                        </div>
                    </div>
                </div>
            </div>

            {/* Right side - Reduced Size Image */}
            <div className="flex-1 hidden lg:flex items-center justify-center p-8 bg-background">
                <div className="flex items-center justify-center h-full">
                    <img
                        src={clockimage}
                        alt="Finance Analytics"
                        className="max-w-full max-h-[94vh] object-contain"
                    />
                </div>
            </div>
        </div>
    );
};

export default SignUp;
